/** Implementation of the MethodManager interface method beginCall
*/
UaStatus TrafficDesignFolderTypeBase::beginCall(
    MethodManagerCallback* pCallback,
    const ServiceContext&  serviceContext,
    OpcUa_UInt32           callbackHandle,
    MethodHandle*          pMethodHandle,
    const UaVariantArray&  inputArguments)
{
    UaStatus            ret;

    OpcUa::MethodCallJob* pCallJob = new OpcUa::MethodCallJob;
    pCallJob->initialize(this, pCallback, serviceContext, callbackHandle, pMethodHandle, inputArguments);
    ret = NodeManagerRoot::CreateRootNodeManager()->pServerManager()->getThreadPool()->addJob(pCallJob);
    if ( ret.isBad() )
    {
        delete pCallJob;
    }

    return ret;
}

/** Synchronous version of the MethodManager method call executed in a worker thread
*/
UaStatus TrafficDesignFolderTypeBase::call(
    const ServiceContext&  serviceContext,
    MethodHandle*          pMethodHandle,
    const UaVariantArray&  inputArguments,
    UaVariantArray&        outputArguments,
    UaStatusCodeArray&     inputArgumentResults,
    UaDiagnosticInfos&     inputArgumentDiag)
{
    UaStatus            ret;
    MethodHandleUaNode* pMethodHandleUaNode = (MethodHandleUaNode*)pMethodHandle;
    UaMethod*           pMethod             = NULL;

    if (pMethodHandleUaNode)
    {
        pMethod = pMethodHandleUaNode->pUaMethod();

        if (pMethod)
        {
            if ( ( (m_pGetAllStreamComputedResultMethod != NULL) && (pMethod->nodeId() == m_pGetAllStreamComputedResultMethod->nodeId()) )
                 || ( (s_pGetAllStreamComputedResultMethod != NULL) && (pMethod->nodeId() == s_pGetAllStreamComputedResultMethod->nodeId()) ) )
            {
                if ( inputArguments.length() > 0 )
                {
                    ret = OpcUa_BadTooManyArguments;
                }
                else
                {
                    MoxaClassBased::StreamComputedResultDataTypes StreamResult;
                    OpcUa_UInt32 ErrorCode = 0;
                    UaString ErrorMessage;
                    UaVariant value;
                    UaStatus tmpRet;

                    ret = this->GetAllStreamComputedResult(serviceContext, StreamResult, ErrorCode, ErrorMessage);
                    if ( ret.isNotBad() )
                    {
                        outputArguments.create(3);
                        StreamResult.toVariant(outputArguments[ 0 ], OpcUa_True);
                        value.setUInt32(ErrorCode);
                        outputArguments[ 1 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                        value.setString(ErrorMessage);
                        outputArguments[ 2 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                    }
                }

            }
            else if ( ( (m_pGetStreamComputedResultMethod != NULL) && (pMethod->nodeId() == m_pGetStreamComputedResultMethod->nodeId()) )
                      || ( (s_pGetStreamComputedResultMethod != NULL) && (pMethod->nodeId() == s_pGetStreamComputedResultMethod->nodeId()) ) )
            {
                if ( inputArguments.length() < 1 )
                {
                    ret = OpcUa_BadArgumentsMissing;
                }
                else if ( inputArguments.length() > 1 )
                {
                    ret = OpcUa_BadTooManyArguments;
                }
                else
                {
                    inputArgumentResults.create(1);

                    MoxaClassBased::StreamComputedResultDataType StreamResult;
                    OpcUa_UInt32 ErrorCode = 0;
                    UaString ErrorMessage;
                    UaVariant value;
                    UaStatus tmpRet;

                    UaString StreamName;
                    value = inputArguments[ 0 ];
                    StreamName = value.toString();
                    inputArgumentResults[ 0 ] = tmpRet.statusCode();
                    if (tmpRet.isNotGood()) {ret = tmpRet;}

                    if ( ret.isGood() )
                    {
                        ret = this->GetStreamComputedResult(serviceContext, StreamName, StreamResult, ErrorCode, ErrorMessage);
                    }
                    if ( ret.isNotBad() )
                    {
                        outputArguments.create(3);
                        StreamResult.toVariant(outputArguments[ 0 ]);
                        value.setUInt32(ErrorCode);
                        outputArguments[ 1 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                        value.setString(ErrorMessage);
                        outputArguments[ 2 ] = *(OpcUa_Variant*)(const OpcUa_Variant*)value;
                        value.detach();
                    }
                }

            }
            else
            {
                return FolderType::call(serviceContext, pMethodHandle, inputArguments, outputArguments, inputArgumentResults, inputArgumentDiag);
            }
        }
        else
        {
            assert(false);
            ret = OpcUa_BadInvalidArgument;
        }
    }
    else
    {
        assert(false);
        ret = OpcUa_BadInvalidArgument;
    }

    return ret;
}

